import React, { useEffect } from 'react';
import axios from 'axios';

const getPhotos = () => {
    return axios.get('https://picsum.photos/v2/list')
        .then(response => {
            // console.log(response);
            // tra ve mot promise
            return response.data;
        })
        .catch(err => {
            console.log(err);
        });
};

const Photos = () => {
    useEffect(() => {
        getPhotos();
    },[]);
    return (
        <div>
            Photos
        </div>
    );
};

export default Photos;
